svg.script:
var mplay = false;
function $(sel) { return document.querySelector(sel); }

$("#trg").addEventListener("click", function( event ) {
  if (mplay) {
    mplay = false;
    $("#main").setAttribute("class", "state2");
    setTimeout(function(){
        $("#main").setAttribute("class", "");
        mplay = true;
    }, 2750);
  }
}, false);

setTimeout(function(){
    mplay = true;
}, 2500);
